import { useNavigate } from "react-router-dom";
import style from './GridItem.module.css';

export default function GridItem({ produto }) {
    const navigate = useNavigate();

    const movimentar = () => {
        navigate(`/MovimentarProduto/${produto.id}`);
    };


    return (
        <li className={style.item}>
            <span className="form-label fw-bold fs-2">
                Código EAN: {produto.id}<br/> 
                Nome: {produto.nome}<br/> 
                Preço: R${produto.preco} <br/>Categoria: {produto.categoria} <br/>Quantidade: {produto.quantidade}</span>
            <button onClick={movimentar}>Movimentar</button>
        </li>
    );
}
